angular.module("admin-article",["admin-article-edit"]).controller("AdminArticleController",["$scope","$routeParams","$location","Article",function(n,t,i,r){return n.setPage=function(t){return r.query({$filter:"Group/IsDeleted eq false and Group/Channel/IsDeleted eq false",$skip:(t-1)*10},function(t){return n.list=t})},n.setPage(1)}])